css:
:root {
  font-size: 16px;
}
.tab-bar .tab .tab-favicon {
  position: absolute;
  top: .4em;
  width: 16px;
  height: 16px;
}
/* for dark stylesheets.. */
img.favicon {
  -webkit-filter: grayscale(100%) contrast(150%);
}
.workspace .browser-toolbar {
  display: flex;
  position: relative;
  height: 34px;
  font-size: 14px;
  background-image: -webkit-linear-gradient(top, #002b36, transparent);
  box-shadow: inset 0 -8px 8px -4px rgba(0, 0, 0, 0.25);
}
.workspace .browser-toolbar .nav-btns {
  display: inline-block;
  position: relative;
  margin-top: 0.15em;
  height: 1.1em;
  line-height: 1.8em;
}
.workspace .browser-toolbar .nav-btns .octicon {
  font-family: 'Octicons Regular';
  font-size: 1.7em;
  font-weight: normal;
  font-style: normal;
  font-variant: normal;
  text-transform: none;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  display: inline-block;
  padding-left: .2em;
  padding-right: .2em;
  color: rgba(117, 136, 138, 0.6);
  margin-left: 0.1em;
  border: 1px solid transparent;
  border-radius: 0.2em;
}
.workspace .browser-toolbar .nav-btns .octicon.browser-btn:hover {
  border: 1px solid rgba(0, 0, 0, 0.1);
  background-color: #4f555b;
  color: rgba(131, 148, 150, 0.6);
}
.workspace .browser-toolbar .nav-btns .octicon-close {
  margin-right: 5px;
  line-height: 19px;
}
.workspace .browser-toolbar .nav-btns .octicon-sync {
  position: relative;
  top: -1px;
}
.workspace .browser-toolbar .nav-btns .octicon.octicon-close {
  color: #fff;
}
.workspace .browser-toolbar .nav-btns .octicon.octicon-close:before {
  content: "\f0a7";
  font-size: 14px;
}
.workspace .browser-toolbar .nav-btns .octicon.octicon-arrow-left:before {
  content: "\f040";
}
.workspace .browser-toolbar .nav-btns .octicon.octicon-arrow-right:before {
  content: "\f03e";
}
.workspace .browser-toolbar .nav-btns .octicon.octicon-sync:before {
  content: "\f087";
  font-size: 21px;
}
.workspace .browser-toolbar .nav-btns .octicon.octicon-three-bars:before {
  content: "\f05e";
}
.workspace .browser-toolbar .nav-btns.left {
  order: 1;
}
.workspace .browser-toolbar .favicon {
  position: absolute;
  left: 0.5em;
  top: .55em;
  width: 16px;
  height: 16px;
  z-index: 1;
}
.workspace .browser-toolbar .omnibox-container {
  flex: 1;
  order: 3;
}
.workspace .browser-toolbar .omnibox-container .omnibox {
  position: relative;
  margin-left: .4em;
  margin-right: .4em;
}
.workspace .browser-toolbar .omnibox-container .omnibox input {
  position: relative;
  top: .3em;
  height: 1.7em;
  width: 100%;
  padding-left: 1.6em;
  padding-right: 0.2em;
  font-size: 14px;
  box-shadow: none;
  border: 1px solid rgba(0, 0, 0, 0.1);
  color: rgba(131, 148, 150, 0.8);
  background-color: transparent;
}
.workspace .browser-toolbar .omnibox-container .omnibox input::selection {
  background-color: #607d8b;
}
.workspace .browser-toolbar .omnibox-container .omnibox input:focus {
  background-color: #ffffff;
}
.workspace .browser-toolbar .nav-btns.right {
  order: 4;
}
.workspace .browser-page .iframe {
  width: 100%;
  height: 100%;
  border: none;
  margin: 5px;
}
.workspace .browser-page .webview,
.workspace .browser-page webview {
  width: 100%;
  height: 100%;
  border: none;
  margin: 5px;
  margin-top: 34px;
}
.holder-hidden {
  top: -9999px;
  left: -9999px;
  width: 1px;
  height: 1px;
  visibility: hidden;
}
